DROP VIEW IF EXISTS `student_info`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `student_info` AS select `student`.`userID` AS `userID`,`student`.`userName` AS `userName`,`student`.`userSex` AS `userSex`,`student`.`markYear` AS `markYear`,`student`.`photo` AS `photo`,`student`.`userAge` AS `userAge`,`class`.`className` AS `className`,`major`.`majorName` AS `majorName`,`major`.`majorID` AS `majorID`,`student`.`memo` AS `memo` from (((`student` join `class`) join `major`) join `department`) where ((`student`.`classID` = `class`.`classID`) and (`class`.`majorID` = `major`.`majorID`) and (`major`.`deptID` = `department`.`deptID`)) order by `student`.`userID`;

